import React, { Component } from 'react'

class Infotest extends Component {
    render() {
        return (
            <div>
                <div className="info-container">
                    <div>
                        <div>Hello</div>
                        <div>Hi</div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Infotest
